import React from "react";


function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
        <ul class="navbar-nav">
            <li class="nav-item"><a href="/">Clicky Game</a></li>
            <li>Click an image to begin!</li>
            <li>Scores go here!</li>

        </ul>
    </nav>
  );
}

export default Nav;
